import React, { useContext } from "react";
import styled from "styled-components";
import MemberTemplate from "./MemberTemplate";
import MemberList from "./MemberList";
const MemberBlock = styled.div`
  width: 100vw;
  height: 100vh;
  background: white;
`;
const MemberHead = styled.div`
  width: auto;
  height: 10vh;
  background: #efe3e3;
  text-align: left;
  font-weight: bold;
  font-size: 3rem;
  padding-top: 20px;
  padding-left: 20px;
`;

function Member({ member }) {
  return (
    <MemberBlock>
      <MemberTemplate>
        <MemberHead>Student</MemberHead>
        {member.map((member) => (
          <MemberList
            key={member.id}
            id={member.id}
            name={member.name}
            img={member.img}
          />
        ))}
      </MemberTemplate>
    </MemberBlock>
  );
}

export default Member;
